(2, 'bako-sahakyann-u-tigran-avinyan-knnarkel-en-arcaxi-ew-hayastani-tntesakan-hamagorcakcutyann-arncvog-harcer', 'Բակո Սահակյանն ու Տիգրան Ավինյանը քննարկել են Արցախի եւ Հայաստանի տնտեսական համագործակցությանն առնչվող հարցեր', '', '', 'Արցախի Հանրապետության Նախագահ Բակո Սահակյանը սեպտեմբերի 15-ին հանդիպում է ունեցել ՀՀ փոխվարչապետ Տիգրան Ավինյանի հետ: Ինչպես «Արմենպրես»-ին տեղեկացրին Արցախի Հանրապետության նախագահի աշխատակազմի տեղեկատվության գլխավոր վարչությունից, հանդիպմանը, որին մասնակցում էր ԱՀ պետնախարար Գրիգորի Մարտիրոսյանը, քննարկվել են Արցախի եւ Հայաստանի տնտեսական համագործակցությանն առնչվող հարցեր։\r\n\r\nԱյնուհետեւ հանդիպումը շարունակվել է ընդլայնված կազմով՝ ՀՀ եւ ԱՀ կառավարությունների մի խումբ անդամների մասնակցությամբ, որի ընթացքում քննարկվել են էներգետիկայի, գյուղատնտեսության, տրանսպորտի, ենթակառուցվածքների, բնապահպանության ոլորտներում մի շարք համատեղ ծրագրերի իրականացմանը վերաբերող հարցեր:', '', '', '', '', '', NULL, 'Բակո Սահակյանն ու Տիգրան Ավինյանը քննարկել են Արցախի եւ Հայաստանի տնտեսական համագործակցությանն առնչվող հարցեր', '', '', NULL, '', '', 1, NULL, NULL, 'http://storage.loc:82/source', '1/LTm1-2QRaLRmDYv_hGNJnlTdpfh7_2Lh.jpg', 1, 1, 1, 1536578615, 1537097250, 1537097559),
(3, 'bako-sahakyann-ndunel-e-fransia-hayastan-barekamutyan-xmbi-naxagah-zilber-lyuk-dvinazin', 'Բակո Սահակյանն ընդունել է «Ֆրանսիա-Հայաստան» բարեկամության խմբի նախագահ Ժիլբեր-Լյուկ Դըվինազին', '', '', 'Արցախի Հանրապետության Նախագահ Բակո Սահակյանը սեպտեմբերի 15-ին ընդունել է Ֆրանսիայի Սենատում «Ֆրանսիա-Հայաստան» բարեկամության խմբի նախագահ Ժիլբեր-Լյուկ Դըվինազին: Ինչպես «Արմենպրես»-ին տեղեկացրին Արցախի Հանրապետության նախագահի աշխատակազմի տեղեկատվության գլխավոր վարչությունից, քննարկվել են Արցախի եւ Ֆրանսիայի հարաբերություններին վերաբերող հարցեր: Հատուկ ուշադրություն է դարձվել խորհրդարանական կապերի զարգացմանը:\r\n\r\nՆախագահ Սահակյանն ընդգծել է, որ Ֆրանսիայի հետ բարեկամության շարունակական ամրապնդումն Արցախի արտաքին քաղաքականության կարեւոր ուղղություններից մեկն է՝ նշելով, որ երկկողմ հարաբերությունների ընդլայնման եւ խորացման համար առկա են բավարար նախադրյալներ:', '', '', '', '', '', NULL, 'Արցախի Հանրապետության Նախագահ Բակո Սահակյանը սեպտեմբերի 15-ին ընդունել է Ֆրանսիայի Սենատում «Ֆրանսիա-Հայաստան» բարեկամության խմբի նախագահ Ժիլբեր-Լյուկ Դըվինազին: ', '', '', NULL, '', '', 1, NULL, NULL, 'http://storage.loc:82/source', '1/RavWye5I36gPedWJ5N9UAMKiP1RNhNoJ.jpg', 1, 1, 1, 1537097292, 1537097328, 1537097592),
(4, 'armen-sargsyan-stepanakerti-husahamalirum-harganki-turk-e-matucel-arcaxyan-azatamarti-zoheri-hisatakin', 'Արմեն Սարգսյանը Ստեփանակերտի հուշահամալիրում հարգանքի տուրք է մատուցել արցախյան ազատամարտի զոհերի հիշատակին', '', '', 'Աշխատանքային այցով Արցախի Հանրապետությունում գտնվող Հայաստանի Հանրապետության նախագահ Արմեն Սարգսյանը, Արցախի Հանրապետության նախագահ Բակո Սահակյանի հետ  այցելել է Ստեփանակերտի հուշահամալիր։\n\nԻնչպես տեղեկացրին ՀՀ նախագահի աշխատակազմի հասարակայնության հետ կապերի վարչությունից, նախագահները հարգանքի տուրք են մատուցել Արցախյան ազատամարտում եւ Հայրենական մեծ պատերազմում զոհվածների, Արցախի Գերագույն խորհրդի առաջին նախագահ Արթուր Մկրտչյանի հիշատակին:\n\nՊատասխանելով լրագրողների հարցերին՝ Հանրապետության նախագահ Արմեն Սարգսյանը նշել է․\n\n«Սա ոչ միայն Անկախության, այլեւ հաղթանակի ու ապագայի նկատմամբ վստահության օր է։ Սա այն օրն է, երբ մեր ողջ հայ ժողովուրդը վերադարձրեց հպարտությունը, հաղթանակի քաղցր զգացողությունը, վստահությունն իր ուժերի եւ ապագայի նկատմամբ։\n\nՄեր ողջ ժողովրդի համար ինչ-որ իմաստով սա առաքելության եւ ազգային ինքնության օր է։ Հոգիս լցված է հպարտությամբ, ուրախությամբ, սակայն այս պահին այստեղ, այս հուշահամալիրում գտնվելով, չեմ կարող չմտածել, թե հաղթանակը, հպարտությունը, ապագայի նկատմամբ վստահությունը ինչ թանկ գնով են ձեռք բերվել՝ մարդկային լավագույն կյանքերի։ Մեր տղաներն իրենց կյանքն իզուր չեն տվել․ տվել են նրա համար, որպեսզի այս երկիրը դառնա ավելի հզոր, որպեսզի ամբողջ աշխարհում սփռված հայությունը, մեր ողջ հայ ժողովուրդը՝ Հայաստանում, Սփյուռքում եւ Արցախում կարողանա կառուցել իր հպարտ, ուժեղ ու հզոր հայրենիքը»։', '', '', '', '', '', NULL, 'Աշխատանքային այցով Արցախի Հանրապետությունում գտնվող Հայաստանի Հանրապետության նախագահ Արմեն Սարգսյանը, Արցախի Հանրապետության նախագահ Բակո Սահակյանի հետ  այցելել է Ստեփանակերտի հուշահամալիր։', '', '', NULL, '', '', 1, NULL, NULL, 'http://storage.loc:82/source', '1/fq2yeTd8TVXmj8CdyuRI6ybZfvEiGOE3.jpg', 1, 1, 1, 1536147020, 1537097446, 1537097513),
(5, 'hh-naxagah-snorhavorakan-ugerj-e-hgel-arcaxi-ankaxutyan-toni-artiv', 'ՀՀ նախագահը շնորհավորական ուղերձ է հղել Արցախի անկախության տոնի առթիվ', '', '', 'Հայաստանի Հանրապետության նախագահ Արմեն Սարգսյանը շնորհավորական ուղերձ է հղել Արցախի Հանրապետության անկախության 27-ամյակի կապակցությամբ: Ուղերձում, մասնավորապես, ասված է.\r\n\r\n«Սիրելի՛ հայրենակիցներ, 1991թվականին ընդունված պատմական փաստաթղթով հռչակվեց Լեռնային Ղարաբաղի Հանրապետությունը: Անցած ավելի քան քառորդ դարը փորձության, հաղթանակների ու պետականաշինության հագեցած ժամանակահատված էր: Այս ողջ ընթացքում ձեզ մշտապես պահպանել եւ ոգեւորել է ազատ ապրելու, պայքարելու եւ հաղթելու կամքի ուժը, որը համահայկական երազանքը դարձրեց իրականություն:\r\n\r\nԱնկախության հռչակագրով դրվեց Արցախի պետականաշինության հիմքը: Այսօրվա տոնական մթնոլորտում երախտագիտությամբ վերստին հիշում ենք նրանց, ովքեր ձեւավորեցին այն, ովքեր կռեցին պետականությունը, ովքեր հանուն նրա կյանք, առողջություն զոհաբերեցին:\r\n\r\nՆրանց մասին մտածելով, նրանց հարգանքի տուրք մատուցելով, նրանց մեծարելով՝ մենք զգում ենք ժամանակի միջից հղվող պատգամը Արցախի այսօրվա քաղաքացուն, այսօրվա զինվորին, մեր ողջ ժողովրդին՝ պաշտպանել ու հզորացնել երկիրը, պետությունը, լինել միասնական Հայաստան, Արցախ եւ Սփյուռք:\r\n\r\nԱյդ միասնականության լավագույն վկայությունն Արցախի այսօրվա անկախ հանրապետությունն է, որը վստահորեն առաջ է ընթանում ազատության ու ժողովրդավարության ճանապարհով՝ շարունակական հաջողություններ արձանագրելով պետականաշինության գործընթացում:\r\n\r\nՇնորհավորելով համահայկական տոնի՝ Արցախի անկախության հռչակման 27-րդ տարեդարձի առթիվ՝ մաղթում եմ խաղաղություն, բարեկեցություն եւ հաստատուն հավատ ապագայի հանդեպ»:', '', '', '', '', '', NULL, 'Հայաստանի Հանրապետության նախագահ Արմեն Սարգսյանը շնորհավորական ուղերձ է հղել Արցախի Հանրապետության անկախության 27-ամյակի կապակցությամբ: Ուղերձում, մասնավորապես, ասված է.', '', '', NULL, 'wnJ6LuUFpMo', '', 1, NULL, NULL, 'http://storage.loc:82/source', '1/V-bmmghXrlCTv8BfnkuiQMUAXf1Gig-G.jpg', 1, 1, 1, 1534938265, 1537098300, 1537103816),
(6, 'amenayn-hayoc-katogikos-snorhavorakan-ugerj-e-hgel-arcaxi-naxagahin-ev-zogovrdin', 'Ամենայն Հայոց Կաթողիկոսը շնորհավորական ուղերձ է հղել Արցախի նախագահին և ժողովրդին', '', '', 'Սեպտեմբերի 2-ին Ն.Ս.Օ.Տ.Տ. Գարեգին Երկրորդ Ծայրագույն Պատրիարք և Ամենայն Հայոց Կաթողիկոսը Արցախի Հանրապետության Անկախության տոնի առիթով շնորհավորական ուղերձ է հղել Արցախի նախագահ Բակո Սահակյանին և բարեպաշտ ժողովրդին:\r\n\r\nՇնորհավորագրում մասնավորապես ասվում է.\r\n«Մայր Աթոռ Սուրբ Էջմիածնից Հայրապետական Մեր օրհնությունն ու շնորհավորանքներն ենք բերում Ձեզ, Արցախի իշխանություններին և բարեպաշտ Մեր ժողովրդին Անկախության տոնի առիթով:\r\n\r\nԳոհունակության, ցնծության և հպարտության զգացումով է այսօր լցված Մեր հոգին: Ազգովի տոնում ենք 27-րդ տարեդարձը Արցախի Հանրապետության անկախության, 27-րդ տարեդարձը արցախահայության ազատ, արժանապատիվ կյանքով ապրելու կամարտահայտության: Մեր մտապատկերում վեր են հառնում դժվարին տարիներն արցախյան գոյապայքարի: Առ Աստված ապավինությամբ ազգս հայոց ոտքի կանգնեց պաշտպանելու իր արդար իրավունքները հայրենի պատմական Արցախում՝ փաստելով, որ Հայոց Ցեղասպանությամբ հայ ժողովրդի համար բացված 20-րդ դարը չի կարող մայր մտնել նույնպիսի ոճրագործությամբ: Հաղթանակեց հայրենիքի հանդեպ անմնացորդ սերն ու նվիրումը: Մեր ժողովրդի արի զավակները արյան գնով ու անօրինակ սխրանքներով ազատագրեցին հայրենի հողը: Արցախյան հերոսամարտը պսակվեց հռչակումով անկախ պետականության, մի ճանապարհ, որին արցախահայությունը ոտք դրեց գալիք բոլոր դժվարությունների և փորձությունների քաջ գիտակցությամբ և մարտահրավերներին դիմագրավելու հանձնառությամբ:\r\n\r\nՓառք Աստծո, հակառակ ամենածանր պայմանների, բազում դժվարությունների ու նեղությունների, պատերազմի վերսկսման մշտական սպառնալիքի՝ Մեր զավակները, ազատության արժեքի ամենաբարձր գիտակցությամբ, իրենց արժանապատիվ կյանքը կերտեցին և շարունակում են իրենց նախնյաց քաջարի, անկոտրում ոգու և հավատի կրողը մնալ: Մենք հպարտ ենք Արցախի Մեր սիրեցյալ ժողովրդով և աջակից նրա հայրենաշեն ու ազգանվեր ծրագրերին` մշտապես աղոթում ենք նրա խաղաղ, բարօր և արգասաբեր կյանքի համար:\r\n\r\nՄեծարգո Նախագահ, բարձր ենք գնահատում Արցախի առջև ծառացած մարտահրավերների հաղթահարմանն ուղղված Ձեր նվիրումն ու անդուլ ջանքերը և Արցախի մեր բարեպաշտ ժողովրդի իղձերի իրականացմանը միտված ծրագրերը:\r\n\r\nԱղոթում ենք, որ Բարձրյալն Աստված Իր Սուրբ Աջով խաղաղ երկնքի ներքո բարօր պահպանի մեր Արցախ աշխարհը, միասնական ու համախումբ պահի արցախահայությանը` պարգևելով անվրդով ու ապահով, շեն ու պայծառ կյանք»:\r\n\r\nԱմենայն Հայոց Կաթողիկոսը մաղթել է, որ մշտապես զորանա հավատքը և անպարտ մնա ոգին Պաշտպանության բանակի հերոս զինվորների ու հրամանատարների` անառիկ պահպանելու հայրենյաց սահմանները:', '', '', '', '', '', NULL, 'Սեպտեմբերի 2-ին Ն.Ս.Օ.Տ.Տ. Գարեգին Երկրորդ Ծայրագույն Պատրիարք և Ամենայն Հայոց Կաթողիկոսը Արցախի Հանրապետության Անկախության տոնի առիթով շնորհավորական ուղերձ է հղել Արցախի նախագահ Բակո Սահակյանին և բարեպաշտ ժողովրդին:', '', '', NULL, '', '', 1, NULL, NULL, 'http://storage.loc:82/source', '1/qSADtqDrhG_P2lvLniwcqB5Lhvq_NcMh.png', 0, 1, 1, 1535629515, 1537098360, 1537098360),
(7, 'azat-ev-ankax-hanrapetutyan-hrcakum-himnovin-poxec-mer-patmutyan-ntack-bako-sahakyan', 'Ազատ և անկախ հանրապետության հռչակումը հիմնովին փոխեց մեր պատմության ընթացքը. Բակո Սահակյան', '', '', 'Նախագահ Բակո Սահակյանը շնորհավորական ուղերձ է հղել Արցախի Հանրապետության օրվա առթիվ: Ինչպես «Արմենպրես»-ին տեղեկացրին Արցախի Հանրապետության նախագահի աշխատակազմի տեղեկատվության գլխավոր վարչությունից, նա մաղթել է խաղաղություն և նոր հաղթանակներ: Ներկայացնում ենք ուղերձն ամբողջությամբ.\r\n\r\n«Սիրելի՛ հայրենակիցներ, \r\nԱրցախի իշխանությունների եւ անձամբ իմ անունից ի սրտե շնորհավորում եմ  ձեզ Արցախի Հանրապետության օրվա առթիվ:\r\n\r\n1991 թվականի սեպտեմբերի 2-ը չափազանց կարեւոր եւ հիշարժան օր է մեր ժողովրդի կյանքում, քանի որ ազատ եւ անկախ հանրապետության հռչակումը հիմնովին ու արմատապես փոխեց մեր պատմության ընթացքը: Այլեւս մեր ճակատագիրը մեր ձեռքերում էր, մենք էինք մեր ապագայի տերն ու կերտողը: Մեր սերունդն ստանձնեց հսկայական պատասխանատվություն՝ ինչպես մեր նախնիների հիշատակի առջեւ, այնպես էլ հետագա սերունդների, մեր հայրենիքի եւ համայն հայության ապագայի համար:\r\n\r\nԵվ այդ պատասխանատվության զգացումն է, որ այս բոլոր տարիների ընթացքում օգնել է մեզ հաղթահարել անասելի դժվարություններն ու փորձությունները, կառուցել ժողովրդավարական, իրավական ու սոցիալական պետություն, պաշտպանել պատերազմի մեջ հայտնված հայրենիքը, վերականգնել ավերված տնտեսությունը, իրականացնել բազմաբնույթ ծրագրեր՝ ուղղված քաղաքացիների սոցիալական խնդիրների լուծմանը, բնակչության կենսապայմանների բարելավմանը:\r\n\r\nԱյդ պատասխանատվության զգացումն է, որ այսօր պարտավորեցնում է մեզ լինել ավելի ուժեղ եւ ամուր, միասնական ու համախմբված, ամեն ինչ անել` հանուն մեր հայրենիքի զորացման ու բարգավաճման, հանուն համազգային նպատակների իրականացման: Դա են պահանջում մեր հերոս տղաների թափած արյունը եւ այն թանկ գինը, որ վճարել է հայ ժողովուրդն իր ազատության ու անկախության համար:\r\n\r\nԹանկագի՛ն հայրենակիցներ,\r\n\r\nՄեկ անգամ եւս շնորհավորում եմ ձեզ հիշարժան տոնի առթիվ եւ մաղթում խաղաղություն, քաջառողջություն ու նոր հաղթանակներ՝ մեր ժողովրդին ու հայրենիքին»:', '', '', '', '', '', NULL, 'Նախագահ Բակո Սահակյանը շնորհավորական ուղերձ է հղել Արցախի Հանրապետության օրվա առթիվ: Ինչպես «Արմենպրես»-ին տեղեկացրին Արցախի Հանրապետության նախագահի աշխատակազմի տեղեկատվության գլխավոր վարչությունից, նա մաղթել է խաղաղություն և նոր հաղթանակներ: ', '', '', NULL, '', '', 1, NULL, NULL, 'http://storage.loc:82/source', '1/C3zBFGN5YSHkSqI8n0d3esgY3LNT1Yaz.jpg', 1, 1, 1, 1531914371, 1537098446, 1537098446);
